import { GamePk, GUMBO } from "./gumbo.ts";
import { None, Some } from "./option.ts";
import { assertEquals } from "jsr:@std/assert";

Deno.test("simple get game pks test", async () => {
  const gumbo = new GUMBO(new URL("https://statsapi.mlb.com"));
  const result = await gumbo.getGamePks(
    new Date(2025, 3, 25),
    new Some(new Date(2025, 4, 25)),
  );
  assertEquals(432, result.orValue([]).length);
});

Deno.test("simple today get game pks test", async () => {
  const gumbo = new GUMBO(new URL("https://statsapi.mlb.com"));
  const result = await gumbo.getGamePks(
    new Date(),
    new None(),
  );

  console.log(`result: ${JSON.stringify(result)}`);
});

Deno.test("simple get game test", async () => {
  const gumbo = new GUMBO(new URL("https://statsapi.mlb.com"));
  const pk = new GamePk("778141");
  const result = await gumbo.getGame(pk);

  assertEquals(result, GUMBO.GameFromRaw(testable_game_raw));
});

Deno.test("simple get game test (cached)", async () => {
  const result = await GUMBO.GameFromRaw(testable_game_raw);

  console.log(`result: ${result}`);
});

Deno.test("simple get game - current play test (cached)", async () => {
  const result = await GUMBO.GameFromRaw(testable_game_raw);
  console.log(`current play: ${result.liveData.currentPlay}`);
});

